import "../stylesheets/App.css";
import React from "react";

function App(props) {
  return (
    <div className="App">
      <header class="header"></header>
      <main className="container">
        <h3>Lista de Tareas</h3>
        <ul>
          <li>
            <div>
              <input type="checkbox"></input>
            </div>
          </li>
        </ul>
      </main>
    </div>
  );
}

export default App;
